import { Button, Paper, ThemeProvider } from "@mui/material";
import React from "react";
import HeroSection from "./components/HeroSection";
import ResponsiveAppBar from "./components/ResponsiveAppBar";
import SubSection1 from "./components/SubSection1";
import GlobalStyled from "./config/GlobalStyled";
import defaultTheme from "./config/Theme/defaultTheme";
import HelpIcon from "@mui/icons-material/Help";
import PriceSection from "./components/PriceSection";

function App() {
  return (
    <>
      <ThemeProvider theme={defaultTheme}>
        <GlobalStyled />
        <Paper elevation={5} sx={{ borderRadius: "1rem" }}>
          <ResponsiveAppBar />
          <HeroSection />
          <SubSection1 />
          <PriceSection />
          <Button
            sx={{
              padding: "1rem",
              position: "absolute",
              left: "9%",
              bottom: "1",
            }}
          >
            <HelpIcon color="primary" sx={{ fontSize: "3rem" }} />
          </Button>
        </Paper>
      </ThemeProvider>
    </>
  );
}

export default App;
